import React, { Component } from 'react'

class Form extends Component {
    constructor(props) {
        super(props)

        this.state = {
             username:" ",
             email:" ",
             topic:"react"
        }
    }

    changeHandler=(event)=>{
        this.setState({
            username:event.target.value

        })
    }
    changeHandlerEmail=(event)=>{
        this.setState({
            email:event.target.value

        })
    }
    changeHandlerTopic=(event)=>{
        this.setState({
            topic:event.target.value

        })

    }

    render() {
        return (
           <form>
               <div>
                <label>Username</label>
                <input type='text'value={this.state.username} onChange={this.changeHandler}></input>
                </div>
                <div>
                    <label>Email</label>
                    <input type='text'value={this.state.email} onChange={this.changeHandlerEmail}></input>
                </div>
                <div>
                    <select value={this.state.topic}onChange={this.changeHandlerTopic}></select>
                    <option value="react">React</option>
                    <option value="angular">React</option>
                    <option value="vue">React</option>


                </div>

           </form>
        )
    }
}

export default Form
